        //Se crea el producto\n                this.addProducto(pId);\n\n                this.file = new File([\"\"], '');\n              })\n            });\n          }else{\n            alert(\"La imagen debe pesar menos de 5MB!\");\n            this.file = new File([\"\"], '');\n          }\n        } else {\n          //Se crea el producto\n          this.addProducto(pId);\n        }\n  }\n\n  addProducto(pId: string) {\n    //Se añade el producto a la bd\n    let producto = new ProductoAdmin(pId, this.nombre, this.url);\n    let produ = Object.assign({}, producto);\n    this.firestoreService.subirProductoAdmin(produ);\n  }\n}\n\n    \n\n    \n        \n    Nombre Producto\n    \n        \n    \n\n    Selecciona una imagen\n    \n        \n    \n\n\n    Crear\n\n    \n\n    \n                \n                    ./add-productos-admin.component.scss\n                \n                \n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '    Nombre Producto                    Selecciona una imagen                    Crear'\n    var COMPONENTS = [{'name': 'AddProductosAdminComponent', 'selector': 'app-add-productos-admin'},{'name': 'AppComponent', 'selector': 'app-root'},{'name': 'CabeceraComponent', 'selector': 'app-cabecera'},{'name': 'CajonComponent', 'selector': 'app-cajon'},{'name': 'CajonItemAddComponent', 'selector': 'app-cajon-item-add'},{'name': 'CajonItemComponent', 'selector': 'app-cajon-item'},{'name': 'CarouselComponent', 'selector': 'app-carousel'},{'name': 'FamiliaComponent', 'selector': 'app-familia'},{'name': 'InicioSesionComponent', 'selector': 'app-inicio-sesion'},{'name': 'LandingPageComponent', 'selector': 'app-landing-page'},{'name': 'NeveraComponent', 'sel